import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import MainContent from "./MainContent";

function App() {
  return (
    <div>
      <nav>
        <h1>My Ugly Little To Do List</h1>
        <ul>
          <li>Pinterest Healthy Dinner Recipes</li>
          <li>Study React</li>
          <li>Plan outfit for tomorrow</li>
          <li>Catch up on The Bachelorette</li>
        </ul>
      </nav>
      <MainContent />
      <Footer />
    </div>
  );
}

export default App;
